import React from 'react'
import './Cart.css'

function CartPage() {

  const cart = [
    {
      id:1,
      quantity:2,
      price:10,
      title: "samsung",
      img: "/images/products/mobiles/m1.jpg"
    },
    {
      id:2,
      quantity:4,
      price:100,
      title: "nokia",
      img: "/images/products/mobiles/m2.jpg"
    }
  ]
  return (
    <div>
      CartPage
    </div>
  )
}

export default CartPage
